import { Nav } from "./Nav";
import { withRouter } from "react-router-dom";

export class AboutUs extends Component {
  render() {
    return (
      <div className="col-sm-12">
      <Nav/>
        <p>This is about us</p>
      </div>
    );
  }
}
export default  withRouter(AboutUs);
